 SET character_set_client = utf8mb4 ;
CREATE TABLE `lte_orders` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `fy` year(4) NOT NULL,
  `date` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `customer` int(11) NOT NULL,
  `mobile` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `outlet` int(11) NOT NULL,
  `items` json NOT NULL,
  `sub_total` double NOT NULL DEFAULT '0',
  `discount` double NOT NULL DEFAULT '0',
  `delivery_fee` double NOT NULL DEFAULT '0',
  `vat` double NOT NULL DEFAULT '0',
  `net_payable` double NOT NULL DEFAULT '0',
  `paid` double NOT NULL DEFAULT '0',
  `remarks` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` enum('Pending','Confirmed','Canceled','Completed') COLLATE utf8mb4_unicode_ci NOT NULL,
  `entry_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `entry_by` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `update_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_by` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
